// recreating the `Stripe` object on every render.
const stripePromise = loadStripe("pk_test_51HpWUdAHdk3LQCR4NdO1v4XGdIci4KVffOBjlY3p84Y65CDxa2wz3NgaGAxoLDAFDbh8UoAy85cqHWNd5I5MyypH00fcFtkQqs");

const Checkout = () => {
  return (
    <Elements stripe={stripePromise}>
        <div className = "container">
      <CardElement />
      </div>
    </Elements>
  );
};
export default Checkout;
